'No Stress Nookie' - Brooklyn has a bad back, and cleaning the pool is doing nothing to help her. Luckily, her neighbor Keiran used to be a professional massage therapist, and he knows exactly how to help Brooklyn get rid of her back pains!

'A Dirty Masseuse' -Bill Bailey is one lucky guy. His lovely wife paid for a massage for his birthday. Little do they know that the spa would send over stunning vixen Alexis Monroe. She massages her client and more!

'From Head To Toe' - Karina goes to her neighbor to borrow some eggs, she notices he has a massage table. Unfortunately, the poor devil doesn't have any eggs, but he offers to relieve all of her stress with a complete message: From Head To Toe!

'Massaging The Ex' - Diana and Bill have been broken up for ages, but that doesn't mean that Bill can't give his ex-girlfriend a friendly massage. We all know what massages are for though...getting laid!

